import React from "react";


var MainContainer = React.createClass({
    render: function() {
        return (
            <div>
                <title>Reverse Geocoding</title>
                <style type="text/css" dangerouslySetInnerHTML={{__html: "
      /* Always set the map height explicitly to define the size of the div
       * element that contains the map. */
      #map {
        height: 100%;
      }

      /* Optional: Makes the sample page fill the window. */
      html,
      body {
        height: 100%;
        margin: 0;
        padding: 0;
      }

      #floating-panel {
        position: absolute;
        top: 10px;
        left: 25%;
        z-index: 5;
        background-color: #fff;
        padding: 5px;
        border: 1px solid #999;
        text-align: center;
        font-family: "Roboto", "sans-serif";
        line-height: 30px;
        padding-left: 10px;
      }

      #floating-panel {
        position: absolute;
        top: 5px;
        left: 50%;
        margin-left: -180px;
        width: 350px;
        z-index: 5;
        background-color: #fff;
        padding: 5px;
        border: 1px solid #999;
      }

      #latlng {
        width: 225px;
      }
    " }} />
                <div id="floating-panel">
                    <input id="latlng" type="text" defaultValue="40.714224,-73.961452" />
                    <input id="submit" type="button" defaultValue="Reverse Geocode" />
                </div>
                <div id="map" />
            </div>
        );
    }
});

export default MainContainer;
